﻿using UnityEngine;
using UnityEngine.InputSystem;

namespace Tests
{
    public class AvatarBridge : GameObjectBridge
    {
        public bool isGrounded
        {
            get => isGroundedBridge.value;
            set => isGroundedBridge.value = value;
        }
        private readonly FieldBridge<bool> isGroundedBridge;

        public float movementSpeed
        {
            get => movementSpeedBridge.value;
            set => movementSpeedBridge.value = value;
        }
        private readonly FieldBridge<float> movementSpeedBridge;

        public float jumpSpeed
        {
            get => jumpSpeedBridge.value;
            set => jumpSpeedBridge.value = value;
        }
        private readonly FieldBridge<float> jumpSpeedBridge;

        public InputAction movementAction => movementActionBridge.value;
        private readonly FieldBridge<InputAction> movementActionBridge;
        public InputAction jumpAction => jumpActionBridge.value;
        private readonly FieldBridge<InputAction> jumpActionBridge;

        public Rigidbody2D rigidbody
        {
            get;
            private set;
        }
        public BoxCollider2D collider
        {
            get;
            private set;
        }

        public AvatarBridge(GameObject gameObject) : base(gameObject)
        {
            isGroundedBridge = FindField<bool>(nameof(isGrounded));
            movementSpeedBridge = FindField<float>(nameof(movementSpeed));
            jumpSpeedBridge = FindField<float>(nameof(jumpSpeed));
            movementActionBridge = FindField<InputAction>(nameof(movementAction));
            jumpActionBridge = FindField<InputAction>(nameof(jumpAction));
            rigidbody = FindComponent<Rigidbody2D>();
            collider = FindComponent<BoxCollider2D>();
        }
    }
}

﻿using NUnit.Framework;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using UnityEngine;

namespace Tests
{
    public class FieldBridge<T>
    {
        public T value
        {
            get
            {
                var (component, field) = fieldInfos.First();
                return (T)field.GetValue(component);
            }
            set
            {
                var (component, field) = fieldInfos.First();
                field.SetValue(component, value);
            }
        }
        private readonly (Component, FieldInfo)[] fieldInfos;
        public FieldBridge(GameObject obj, string name)
        {
            fieldInfos = FindFields(obj, name).ToArray();
            Assert.AreEqual(1, fieldInfos.Length, $"There must be exactly 1 field with the name of '{name}' in GameObject '{obj}'!");
        }
        private IEnumerable<(Component, FieldInfo)> FindFields(GameObject obj, string name)
        {
            foreach (var component in obj.GetComponents<Component>())
            {
                var fields = component
                    .GetType()
                    .GetFields()
                    .Where(f => f.Name == name);
                foreach (var field in fields)
                {
                    yield return (component, field);
                }
            }
        }
    }
}

﻿using NUnit.Framework;
using UnityEngine;

namespace Tests
{
    public abstract class GameObjectBridge
    {
        public Vector3 position
        {
            get => transform.position;
            set => transform.position = value;
        }
        public Vector3 scale
        {
            get => transform.localScale;
            set => transform.localScale = value;
        }
        public Transform transform
        {
            get;
            private set;
        }
        public readonly GameObject gameObject;
        public GameObjectBridge(GameObject gameObject)
        {
            this.gameObject = gameObject;
            transform = FindComponent<Transform>();
        }

        protected FieldBridge<T> FindField<T>(string name)
        {
            return new FieldBridge<T>(gameObject, name);
        }
        protected T FindComponent<T>() where T : Component
        {
            var components = gameObject.GetComponents<T>();
            Assert.AreEqual(1, components.Length, $"There must be exactly 1 component of type of type '{typeof(T)}' in GameObject '{gameObject}'!");
            return components[0];
        }
    }
}

